		/// <summary>
		/// レポートスタートイベント
		/// </summary>
		/// <param name="sender">対象オブジェクト</param>
		/// <param name="eArgs">イベントハンドラ</param>
		/// <remarks>
		/// <br>Note		: レポートの生成処理が開始されたときに発生します。</br>
		/// <br>Programmer	: 18012 Y.Sasaki</br>
        /// <br>Date		: 2005.11.09</br>
        /// <br>Update Note : 2013/01/04 田建委</br>
        /// <br>管理番号    : 10806793-00 2013/03/13配信分</br>
        /// <br>              Redmine#34098 罫線印字制御の追加対応</br>
        /// <br>Update Note : 2013/02/23 王君</br>
        /// <br>管理番号    : 10806793-00 2013/03/13配信分</br>
        /// <br>              Redmine#34098 罫線印字制御の追加対応</br>
        /// <br>Update Note : 2020/02/27 3H　尹安</br>
        /// <br>管理番号    : 11570208-00 軽減税率対応</br>
		/// </remarks>
		private void MAHNB02343P_02A4C_ReportStart(object sender, System.EventArgs eArgs)
		{
            // 条件取得
            this._extraInfo = (ExtrInfo_MAHNB02347E)this._printInfo.jyoken;

			// 印刷件数初期化
			this._printCount = 0;
			
			// 罫線表示・非表示制御
			foreach (Section section in this.Sections)
			{
				Section targetSection = section; 
				this.SetVisibleRuledLine(ref targetSection);
			}
            // --- ADD  2011/08/05 ---------->>>
            //ＰＣＣオプションが導入している場合
            //if (LoginInfoAcquisition.SoftwarePurchasedCheckForUSB(ConstantManagement_SF_PRO.SoftwareCode_OPT_PM_PCC) == PurchaseStatus.Contract)// DEL  2011/08/08
            if (LoginInfoAcquisition.SoftwarePurchasedCheckForUSB(ConstantManagement_SF_PRO.SoftwareCode_OPT_PM_SCM) == PurchaseStatus.Contract)// ADD  2011/08/08
            {
                this.AutoAnswer.Visible = true;
                this.Label_AutoAnswer.Visible = true;
            }
            else
            {
                // 導入していない場合
                this.AutoAnswer.Visible = false;
                this.Label_AutoAnswer.Visible = false;
            }
            // --- ADD  2011/08/05 ----------<<<<<

            // グループ順制御
            this.ChangeGroupOrder();

            // 原価・粗利出力制御
            this.ChangeCostPrt();

            // 小計印字制御
            this.ChangeSumRec();

            // 2008.11.27 30413 犬飼 改頁制御の変更 >>>>>>START
            // 2008.07.17 30413 犬飼 改頁制御の追加 >>>>>>START
            // 改頁設定
            if (this._extraInfo.NewPageType == 0)
            {
                // 拠点毎
                this.SectionHeader.NewPage = NewPage.Before;

                this.Header1.NewPage = NewPage.None;
                this.Header2.NewPage = NewPage.None;
                this.Header3.NewPage = NewPage.None;
            }
            else if (this._extraInfo.NewPageType == 1)
            {
                // 小計毎
                //this.SectionHeader.NewPage = NewPage.None;
                //this.SectionFooter.NewPage = NewPage.After;

                //this.Header1.NewPage = NewPage.Before;
                //this.Header2.NewPage = NewPage.Before;
                //this.Header3.NewPage = NewPage.Before;
                switch (this._extraInfo.SortOrder)
                {
                    case 0:  // 売上日+伝票番号
                    case 2:  // 入力日+伝票番号
                    case 7:  // 伝票番号    // ADD 2009/06/12
                        {
                            this.SectionHeader.NewPage = NewPage.None;

                            this.Header1.NewPage = NewPage.None;
                            this.Header2.NewPage = NewPage.None;
                            this.Header3.NewPage = NewPage.None;
                            break;
                        }
                    case 1:  // 得意先+売上日+伝票番号
                    case 3:  // 得意先+入力日+伝票番号
                        {
                            this.SectionHeader.NewPage = NewPage.Before;
                            
                            this.Header1.NewPage = NewPage.Before;
                            this.Header2.NewPage = NewPage.None;
                            this.Header3.NewPage = NewPage.None;
                            break;
                        }
                    case 4:  // 担当者+伝票番号
                    case 5:  // 地区+伝票番号
                    case 6:  // 業種+伝票番号
                        {
                            this.SectionHeader.NewPage = NewPage.Before;
                            
                            this.Header1.NewPage = NewPage.Before;
                            this.Header2.NewPage = NewPage.None;
                            this.Header3.NewPage = NewPage.None;
                            break;
                        }
                }
            }
            else
            {
                // 改ページしない
                this.SectionHeader.NewPage = NewPage.None;

                this.Header1.NewPage = NewPage.None;
                this.Header2.NewPage = NewPage.None;
                this.Header3.NewPage = NewPage.None;
            }
            // 2008.07.17 30413 犬飼 改頁制御の追加 <<<<<<END
            // 2008.11.27 30413 犬飼 改頁制御の変更 <<<<<<END

            //----- ADD 2013/01/04 田建委 Redmine#34098 ----->>>>>
            // 罫線印字『印字する』の場合
            if (this._extraInfo.LinePrintDiv == 0)
            {
                this.line3.Visible = false;
                this.line17.Visible = true;
                this.line1.Visible = true;
                //this.line8.Visible = true; // DEL 王君 2013/02/23 Redmine#33741
                this.line8.Visible = false; // ADD 王君 2013/02/23 Redmine#33741
                this.line6.Visible = true;
                this.line16.Visible = true;
                this.line19.Visible = true;
                this.line13.Visible = true;
                this.line12.Visible = true;
                // --- ADD START 3H 尹安 2020/02/27 ----->>>>>
                this.line5.Visible = true;
                this.line7.Visible = true;
                this.line9.Visible = true;
                this.line10.Visible = true;
                this.line14.Visible = true;
                // --- ADD END 3H 尹安 2020/02/27 -----<<<<<
            }
            // 罫線印字『印字しない』の場合
            else
            {
                this.line3.Visible = true;
                this.line17.Visible = false;
                this.line1.Visible = false;
                this.line8.Visible = false;
                this.line6.Visible = false;
                this.line16.Visible = false;
                this.line19.Visible = false;
                this.line13.Visible = false;
                this.line12.Visible = false;
                // --- ADD START 3H 尹安 2020/02/27 ----->>>>>
                this.line5.Visible = false;
                this.line7.Visible = false;
                this.line9.Visible = false;
                this.line10.Visible = false;
                this.line14.Visible = false;
                // --- ADD END 3H 尹安 2020/02/27 -----<<<<<
            }
            //----- ADD 2013/01/04 田建委 Redmine#34098 ----->>>>>
            // --- ADD START 3H 尹安 2020/02/27 ----->>>>>
            if (this._extraInfo.TaxPrintDiv == 1)
            {
                this.label59.Visible = false;
            }else{
                this.label59.Visible = true;
            }
            // --- ADD END 3H 尹安 2020/02/27 -----<<<<<
        }

