			this.SORTTITLE.Text = this._pageHeaderSortOderTitle;

            this.Cheaking.Text = this._pageHeaderSubTitle;

            // ↓ 2007.10.12 Keigo Yata Add ///////////////////////////////////////
            // 抽出条件
