        /// <summary>
        /// Footer7の粗利率を出力処理
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        /// <remarks>
        /// <br>Note		: Footer7の各粗利率を出力します。</br>
        /// <br>Programmer	: 2020/02/27 3H 尹安</br>
        /// </remarks>
        private void Footer7_BeforePrint(object sender, EventArgs e)
        {
            string grossMarginRate = "";
            string grossMarginMark = "";

            // 売上の粗利率を設定
            grossMarginRate = this.Footer7_SalesGrossMarginRate.Text;
            grossMarginMark = this.Footer7_SalesGrossMarginMark.Text;
            // 粗利率設定
            SetGrossMargin(this.Footer7_SalesDtl.Text, this.Footer7_SalesCostDtl.Text, ref grossMarginRate, ref grossMarginMark);
            this.Footer7_SalesGrossMarginRate.Text = grossMarginRate;
            this.Footer7_SalesGrossMarginMark.Text = grossMarginMark;

            // 返品の粗利率を設定
            grossMarginRate = this.Footer7_ReturnGrossMarginRate.Text;
            grossMarginMark = this.Footer7_ReturnGrossMarginMark.Text;
            // 粗利率設定
            SetGrossMargin(this.Footer7_ReturnDtl.Text, this.Footer7_SalesReturnCostDtl.Text, ref grossMarginRate, ref grossMarginMark);
            this.Footer7_ReturnGrossMarginRate.Text = grossMarginRate;
            this.Footer7_ReturnGrossMarginMark.Text = grossMarginMark;

            // 値引きの粗利率を設定
            grossMarginRate = this.Footer7_DistGrossMarginRate.Text;
            grossMarginMark = this.Footer7_DistGrossMarginMark.Text;
            // 粗利率設定
            SetGrossMargin(this.Footer7_DistDtl.Text, this.Footer7_DistDtlCost.Text, ref grossMarginRate, ref grossMarginMark);
            this.Footer7_DistGrossMarginRate.Text = grossMarginRate;
            this.Footer7_DistGrossMarginMark.Text = grossMarginMark;

            // 純売上の粗利率を設定
            grossMarginRate = this.Footer7_TotalGrossMarginRate.Text;
            grossMarginMark = this.Footer7_TotalGrossMarginMark.Text;

            // 粗利率設定
            SetGrossMargin(this.Footer7_SalesMoneyTaxExc.Text, this.Footer7_Cost.Text, ref grossMarginRate, ref grossMarginMark);
            this.Footer7_TotalGrossMarginRate.Text = grossMarginRate;
            this.Footer7_TotalGrossMarginMark.Text = grossMarginMark;
        }

